import React from "react";
import './TableTennis.css';
import tblimg from '../image/img16.jpg';
function TableTennis() {
    return (
        <>
        <div className="TableTennis">


            <div >
                <h1>TableTennis</h1>
                <img src={tblimg} alt="big " />
            </div>

        </div>
    </>
    );
}

export default TableTennis;
